import React from 'react';
import './Home.css';
import Header from './Header.js';
import Footer from './Footer.js';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Project from './Project.js';



class Home extends React.Component {
  goAbout = () => {
    this.props.history.push("/about");
  }
  goHome = () => {
    this.props.history.push("/");
  }
  goElectry = () => {
    this.props.history.push("/electry");
  }
  goSportsHats = () => {
    this.props.history.push("/sports-hats");
  }
  goChongQingHouse = () => {
    this.props.history.push("/chongqing-house");
  }
  goGooey = () => {
    this.props.history.push("/gooey");
  }
  render() {
    return (
      <div class="home">
        <Header goToHome={this.goHome} goToAbout={this.goAbout} page={"home"}/>
        <div class="intro">
        <Container fluid={true}>
          <Row noGutters={true}>
            <Col xs={12} sm={12} md={6}>
              <div>
                <img src="https://i.ibb.co/BNXhKdX/Continuous-one-line-drawing-of-abstract-girl-face-Beauty-women-sketch-hand-drawn-vector-illustration.jpg"/>
              </div>
            </Col>
            <Col xs={12} sm={12} md={6}>
              <div class="hello">
                <div class="name">Hello! I'm YJ.</div>
                <div>I'm an aspiring software engineer passionate about the intersection of business and technology.</div>
                <br></br>
                <div>   ✨ Graduating Brown University with a degree in Computer Science and Economics.</div>
              </div>
            </Col>
          </Row>
        </Container>        
        </div>
        <div>
          <div>What I'm up to after school </div>
          <div>
            <p>Co-director @ Hack@Brown</p>
            <p>📚 Organizing the largest and oldest hackathon on campus </p>
          </div>
          <div>
            <p>Teaching Assistant @ CS Department</p>
            <p>📚 Leading weekly sections and TA hours for CS0150 Introduction to Object-Oriented Programming and CS0020 The Digital World </p>
          </div>
        </div>
        <div>
          <div>Summertime Experiences </div>
          <div>
            <p>Software Engineer Intern @ Facebook</p>
            <p>🌞 Worked on projects that help make Facebook Communities a safer space</p>
          </div>
          <div>
            <p>Security Intern @ Deloitte</p>
            <p>🌞 Implemented features on internal tools for vulnerability management </p>
          </div>
        </div>
        <div className = "footercenter">
          <Footer />
        </div>
      </div>
    );
  }
}

export default Home;
